      function base64ToBytes(base64String) {
  // Use the atob() method to decode the Base64 string.
  const binaryString = atob(base64String);

  // Get the length of the decoded binary string.
  const length = binaryString.length;

  // Create a new Uint8Array with the same length as the binary string.
  const bytes = new Uint8Array(length);

  // Iterate through the binary string and populate the Uint8Array.
  for (let i = 0; i < length; i++) {
    // Get the character code of each character in the binary string.
    bytes[i] = binaryString.charCodeAt(i);
  }

  // Return the byte array.
  return bytes;
}
